import React from "react";




class Login extends React.Component{
    constructor(props){
        super(props)

    }

    render(){
        return <div className="">
            <div className="register">
                <h2>Register</h2>
                <h3>Enrollment Id:</h3>
                <input type="text"></input>
                <h3>Password:</h3>
                <input type="text"></input>
                <h3>Email Id</h3>
                <input type="text"></input>
                <button>Register</button>

            </div>
            <div className="login"></div>
        </div>
    }
}
 

export default login
